def chain_rule_example():
    """Show chain rule example."""
    x_val, y_val = symbols("x y")
    _y_val = x_val**2 + 1
    dy_dx = diff(_y_val)
    z_val = y_val**3 - 2
    dz_dy = diff(z_val)
    dz_dx_chain = (dy_dx * dz_dy).subs(y_val, _y_val)
    dz_dx_no_chain = diff(z_val.subs(y_val, _y_val))
    print(dz_dx_chain)
    print(dz_dx_no_chain)


chain_rule_example()


