def approximate_integral_example(a_val, b_val, n_val, f_val):
    """Calculate approximate integral."""
    delta_x = (b_val - a_val) / n_val
    total_sum = 0

    for i_val in range(1, n_val + 1):
        midpoint = 0.5 * (2 * a_val + delta_x * (2 * i_val - 1))
        total_sum += f_val(midpoint)

    return total_sum * delta_x


def approximate_integral_function_example(x):
    """Return function for an integral."""
    return x**2 + 1


area = approximate_integral_example(
    a_val=0, b_val=1, n_val=5, f_val=approximate_integral_function_example
)
print(area)


