# *Probability* is the degree of confidence that an event will occur, often expressed as a percentage.
# Likelihood is similar to probability and often confused with it. In everyday language, they can be used as synonyms.
# However, probability quantifies predictions of future events, 
# while likelihood measures the frequency of past events. 
# In statistics and machine learning, likelihood (based on past data) is used 
# to predict probabilities (about the future).
#
#
# *The probability of two independent events happening together* (joint probability) 
# can be calculated by multiplying the probability of each event. 
#
# For mutually exclusive events (which cant happen at the same time), the probability
# of event A or B happening is just the sum of their individual probabilities.
#
# Conditional probability is the chance of an event happening given that another event 
# has already happened. Bayes' formula helps us reverse conditional 
# probabilities to update our beliefs based on new data.

# +
def bayes_example_1():
    """Calculate Bayes conditional probability."""
    p_coffee_drinker = 0.65
    p_cancer = 0.005
    p_coffee_drinker_given_cancer = 0.85
    p_cancer_given_coffee_drinker = (
        p_coffee_drinker_given_cancer * p_cancer / p_coffee_drinker
    )
    print(p_cancer_given_coffee_drinker)


bayes_example_1()


