# The mode is the value that appears most frequently in a data set.
# Its particularly useful for identifying which values occur most often when there are repeated values.

# +
def mode(values: list[int]):
    """Return mode."""
    counts = defaultdict(int)

    for s in values:
        counts[s] += 1

    max_count = max(counts.values())
    modes = [v for v in set(values) if counts[v] == max_count]
    return modes


def calc_mode_example_1():
    """Return mode example 1."""
    sample = [1, 3, 2, 5, 7, 0, 2, 3]
    print(mode(sample))


calc_mode_example_1()


