# Variance is a measure of how far a set of numbers are spread out from their mean.
# Its calculated as the average of the squared differences from the mean.
# ![](data:image/png;base64,)

# +
def variance(values: list[int]):
    """Return variance."""
    mean = sum(values) / len(values)
    _variance = sum((v - mean) ** 2 for v in values) / len(values)
    return _variance


def calc_variance_example_1():
    """Calculate variance example 1."""
    data = [0, 1, 5, 7, 9, 10, 14]
    print(variance(data))


calc_variance_example_1()


# -

# Taking the square root is the inverse operation of squaring,
# so we take the square root of the variance to get
# the standard deviation (also called the root mean square deviation). 
# ![](data:image/png;base64,)
#
# ![](data:image/png;base64,)

# +
def std_dev(values: list[int]):
    """Calculate std."""
    return sqrt(variance(values))


def calc_std_example_1():
    """Calculate std example 1."""
    data = [0, 1, 5, 7, 9, 10, 14]
    print(std_dev(data))


calc_std_example_1()


